const NORMALIZATION_FACTOR: f32 = 0.00002852772;
struct SignalBuffer<T: Num> {
    used: Option<usize>,
    new: Option<usize>,
    end: Option<usize>,
    zero_value: T,
    contents: Vec<T>
}

impl SignalBuffer<num::Complex<f32>> {
    fn insert_real(&mut self, new_real_element: f32) {
        self.end = match self.end  {
            None =>  { self.contents[0].re = new_real_element; self.contents[0].im = 0.0; Some(0) }, // maybe set the imaginary part to zero: self.contents[0].im = 0... we want to guarantee this for general use of the struct, but it's a waste if our implementation doesn't need it
            Some(end_val) => { self.contents[end_val+1].re = new_real_element; self.contents[end_val+1].im = 0.0; Some(end_val+1) }
        };
    }    
}
impl<T> SignalBuffer<T> where T: num::Num  {
    fn set_end(&mut self, end_idx: usize) {  // only for use after "contents" have been directly loaded via FFT process
        self.end = Some(end_idx);
    }
    fn insert(&mut self, new_element: T) {
        self.end = match self.end  {
            None =>  { self.contents[0] = new_element; Some(0) },
            Some(end_val) => { self.contents[end_val+1] = new_element; Some(end_val+1) }
        };
    }
    fn reset(&mut self) {
        self.used = None;
        self.new = self.end;
    }
    fn clear(&mut self) {
        self.used = None;
        self.new = None;
        self.end = None;
    }
    fn next(&mut self) -> T where T:Copy  {
        match self.new.cmp(&self.used) {
            Ordering::Greater =>  match self.used {
                None =>  { self.used = Some(0); self.contents[0] },
                Some(idx) => { self.used = Some(idx+1); self.contents[idx+1] }
            },
            _ => self.zero_value
        }
    }    
}

fn hanning_multiplier(i: f32, block_size: f32) -> f32 {     // Hanning window to minimize spectral leakage; without this, we just get noise
    0.5 * (1.0 - (2.0*PI*i/(block_size-1.0)).cos())
}

fn build_signal_buffer<T: Num>(length: usize, zero_element: T) -> SignalBuffer<T> where T: Clone {
    SignalBuffer { 
        used: None,
        new: None,
        end: None,
        zero_value: zero_element.clone(),
        contents: vec![zero_element; length]
     }
}

fn padded(input: &[f32], total: usize) -> Vec<f32> {
    let num_zeroes = total - input.len();
    let zeroes = vec![0f32; num_zeroes];
    [&input[..], &zeroes[..]].concat()
}

struct ConvoVerb {
    ir_out: Vec<num::Complex<f32>>,
    in_inverse: Vec<num::Complex<f32>>,
    out_inverse: Vec<num::Complex<f32>>,
    inverse_fft: Arc<dyn rustfft::FFT<f32>>,
    output_length: usize,
    forward_fft: Arc<dyn rustfft::FFT<f32>>,
    section_buffer: SignalBuffer<num::Complex<f32>>,
    stored_overlap_buffer: SignalBuffer<f32>,
    next_overlap_buffer: SignalBuffer<f32>,
    section_freq_buffer: SignalBuffer<num::Complex<f32>>,
    output_buffer: SignalBuffer<f32>,
    overlap_length: usize
}

impl Default for ConvoVerb {
    fn default() -> ConvoVerb {
        let ir_signal = IR_SIGNAL_ARRAY.to_vec();
        let ir_length = ir_signal.len();
        let mut total_size: usize = 262144;
        
        let window_size = ABLETON_BUFFER_SIZE;
        let total_target = ABLETON_BUFFER_SIZE + ir_length - 1;
        while total_size < total_target { 
            total_size *= 2;
        }
        let output_length = total_size; // same, just not mutable
        let overlap_length = output_length - window_size;
        let mut ir_wav_arr = padded(&ir_signal, output_length).iter().map(|x| Complex::new(*x, 0f32 )).collect::<Vec<_>>();

        // take FFT of impulse response, save that to a vector for use as the convolution kernel
        let mut ir_planner = FFTplanner::new(false);   // "false" argument -- this is a forward FFT
        let ir_fft = ir_planner.plan_fft(output_length);
        let mut ir_out: Vec<num::Complex<f32>> = vec![Complex::new(0.0,0.0); output_length];
        ir_fft.process(&mut ir_wav_arr, &mut ir_out);

        let section_buffer: SignalBuffer<num::Complex<f32>> = build_signal_buffer(output_length, Complex::new(0f32, 0f32));
        let stored_overlap_buffer: SignalBuffer<f32>  = build_signal_buffer(overlap_length, 0.0);
        let next_overlap_buffer: SignalBuffer<f32>  = build_signal_buffer(overlap_length, 0.0);
        let section_freq_buffer: SignalBuffer<num::Complex<f32>>  = build_signal_buffer(output_length, Complex::new(0f32, 0f32));
        let output_buffer: SignalBuffer<f32>  = build_signal_buffer(window_size, 0.0);

        let mut forward_planner = FFTplanner::new(false);   // "false" argument -- this is a forward FFT
        let forward_fft = forward_planner.plan_fft(output_length);  // 

        let in_inverse: Vec<num::Complex<f32>> = vec![Complex::new(0.0,0.0); output_length];
        let out_inverse: Vec<num::Complex<f32>> = vec![Complex::new(0.0,0.0); output_length];
        let mut inverse_planner = FFTplanner::new(true);    // "true" argument -- this is an inverse FFT
        let inverse_fft = inverse_planner.plan_fft(output_length);    

        ConvoVerb {
            ir_out: ir_out,
            in_inverse: in_inverse,
            out_inverse: out_inverse,
            inverse_fft: inverse_fft,
            output_length: output_length,
            forward_fft: forward_fft,
            section_buffer: section_buffer,
            stored_overlap_buffer: stored_overlap_buffer,
            next_overlap_buffer: next_overlap_buffer,
            section_freq_buffer: section_freq_buffer,
            output_buffer: output_buffer,
            overlap_length: overlap_length,
        }
    }
}

impl Plugin for ConvoVerb {
    fn get_info(&self) -> Info {
        Info {
            name: "ConvoVerb".to_string(),
            vendor: "Valle de Aburra Music".to_string(),
            unique_id: 30385723,
            inputs: 2,
            outputs: 2,
            parameters: 0,

            ..Info::default()
        }
    }

    fn process(&mut self, buffer: AudioBuffer<f32>) {
        //let (inputs, outputs) = buffer.split();
        let mut i_float = 0f32;

        for (input_buffer, output_buffer) in buffer.zip() { // *should* only be 1...
            let buffer_size = input_buffer.iter().len();
            let buffer_size_float = buffer_size as f32;
            for input_sample in input_buffer.iter() {
                self.section_buffer.insert_real(hanning_multiplier(i_float, buffer_size_float) * (*input_sample));
                i_float += 1.0;
            }
            for _ in buffer_size..self.output_length {
                self.section_buffer.insert_real(0.0);    // padding, for buffer
            }
            self.forward_fft.process(&mut self.section_buffer.contents, &mut self.section_freq_buffer.contents);
            self.section_freq_buffer.set_end(self.output_length/2);
            self.section_freq_buffer.reset();

            for (idx, ir_sample) in self.ir_out.iter().enumerate() {
                self.in_inverse[idx] = self.section_freq_buffer.next()*ir_sample; 
            }
            self.inverse_fft.process(&mut self.in_inverse, &mut self.out_inverse);
            self.stored_overlap_buffer.reset();
            self.next_overlap_buffer.clear();
            for k in 0..buffer_size {
                self.output_buffer.insert(self.out_inverse[k as usize].re + self.stored_overlap_buffer.next());
            }
            for k in buffer_size..self.output_length {
                match k.cmp(&self.overlap_length) {
                    Ordering::Less => self.next_overlap_buffer.insert(self.out_inverse[k as usize].re + self.stored_overlap_buffer.next()),
                    _ => self.next_overlap_buffer.insert(self.out_inverse[k as usize].re)
                };
            }
            self.stored_overlap_buffer.clear();
            self.next_overlap_buffer.reset();
            for _ in 0..self.overlap_length {
                self.stored_overlap_buffer.insert(self.next_overlap_buffer.next());
            }
            self.stored_overlap_buffer.reset();
            self.output_buffer.reset();
            for output_sample in output_buffer {
                *output_sample = self.output_buffer.next()*NORMALIZATION_FACTOR;
            }
            self.section_buffer.clear();
            self.section_freq_buffer.clear();
            self.output_buffer.clear();
        }
    }    
}

plugin_main!(ConvoVerb);